import React from "react";
import "../Auth"

export default function Authentication(props) {
  return (
    <div class="container">
      <h1>Responsive Web Design Example</h1>
      <form>
        <input type="text" placeholder="Enter your email address" />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}
